import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const APP_Name = "App-header"
  const clickhandler = () => {
    alert(APP_Name)
  }
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        < p onClick = {
          clickhandler
        } >
         {APP_Name}
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
